column8:
世界初、「貼る！伸びるカーボン！」<br>
特殊繊維素材「カーボン」を特殊技術製法により世界で初めて伸びるシートとして、ゆるやかな曲面・段差にも貼り付けることを可能にしました。<br>
本物故の保護力に加え、スポーティー感・高級感を演出する夢の商品です。<br>
